Actionscript.script:
function 长柄攻击(击倒率)
{
	var 子弹参数 = new Object();
	子弹参数.子弹威力 = _parent.空手攻击力 / 5 + _parent.刀属性.power * 1.5;
	if (_parent.被动技能.刀剑攻击 && _parent.被动技能.刀剑攻击.启用)
	{
		子弹参数.子弹威力 +=  _parent.刀属性.power * _parent.被动技能.刀剑攻击.等级 * 0.075;
	}
	if (_parent.mp攻击加成)
	{
		子弹参数.子弹威力 += _parent.mp攻击加成;
	}
	子弹参数.Z轴攻击范围 = 30;
	子弹参数.击倒率 = 击倒率;

	_parent.刀口位置生成子弹(_parent, 子弹参数);
}
function 长柄重击()
{
	var 子弹参数 = new Object();
	子弹参数.子弹威力 = _parent.空手攻击力 / 3 + _parent.刀属性.power * 2;
	if (_parent.被动技能.刀剑攻击 && _parent.被动技能.刀剑攻击.启用)
	{
		子弹参数.子弹威力 +=  _parent.刀属性.power * _parent.被动技能.刀剑攻击.等级 * 0.075;
	}
	if (_parent.mp攻击加成)
	{
		子弹参数.子弹威力 += _parent.mp攻击加成;
	}
	子弹参数.Z轴攻击范围 = 30;
	子弹参数.击倒率 = 1;

	_parent.刀口位置生成子弹(_parent, 子弹参数);
}

onClipEvent (enterFrame) {
	_parent.攻击时可改变移动方向(20);
}

onClipEvent (enterFrame) {
	if (_parent._parent._name == _root.控制目标)
	{
		_parent.大型武器攻击搓招();
	}
	_parent.变招判定("长柄2连招");
}

